<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>STEP3 Áü≠Â∞∫ÂãïÁîª + ÁêÜËß£Â∫¶„ÉÜ„Çπ„Éà | CareLearn</title>
  <link href="https://fonts.googleapis.com/css2?family=Noto+Sans+JP:wght@300;400;700&family=Noto+Sans:wght@300;400;700&display=swap" rel="stylesheet">
  <style>
    :root {
      --navy: #0F2044; --teal: #1A7F6E; --teal-light: #22A08A;
      --orange: #F5A623; --orange-dark: #E09010; --bg: #F0F4F8;
      --white: #ffffff; --gray-100: #F7F9FB; --gray-200: #E8EDF3;
      --gray-400: #9AA5B4; --gray-600: #4A5568; --green: #2E7D32;
      --green-light: #E8F5E9; --red: #C62828; --red-light: #FFEBEE; --text: #1A202C;
    }
    * { margin: 0; padding: 0; box-sizing: border-box; }
    body { font-family: 'Noto Sans JP','Noto Sans',sans-serif; background: var(--bg); color: var(--text); min-height: 100vh; }
    .phone-wrap { max-width: 390px; margin: 0 auto; background: var(--white); min-height: 100vh; box-shadow: 0 0 40px rgba(0,0,0,0.12); }

    /* HEADER */
    .header { background: var(--navy); padding: 14px 16px; display: flex; align-items: center; justify-content: space-between; position: sticky; top: 0; z-index: 100; }
    .header-logo { color: var(--white); font-size: 15px; font-weight: 700; }
    .header-logo span { color: var(--teal-light); }
    .header-user { display: flex; align-items: center; gap: 8px; }
    .user-info { text-align: right; }
    .user-name { color: var(--white); font-size: 12px; font-weight: 500; }
    .lang-badge { background: var(--teal); color: var(--white); font-size: 10px; padding: 2px 7px; border-radius: 10px; display: inline-block; margin-top: 2px; }
    .avatar { width: 32px; height: 32px; border-radius: 50%; background: var(--teal); display: flex; align-items: center; justify-content: center; color: white; font-size: 13px; font-weight: 700; }

    /* TABS */
    .tabs { display: flex; background: var(--navy); border-top: 1px solid rgba(255,255,255,0.1); }
    .tab-btn { flex: 1; padding: 12px; text-align: center; color: rgba(255,255,255,0.5); font-size: 12px; font-weight: 700; cursor: pointer; border: none; background: none; transition: all 0.2s; }
    .tab-btn.active { color: var(--white); border-bottom: 3px solid var(--teal-light); }

    /* SCREENS */
    .screen { display: none; }
    .screen.active { display: block; }

    /* VIDEO */
    .video-player { position: relative; width: 100%; aspect-ratio: 16/9; background: #0a1628; overflow: hidden; }
    .video-player video { width: 100%; height: 100%; object-fit: cover; display: block; }
    .video-overlay { position: absolute; inset: 0; background: linear-gradient(135deg,#0a1628 0%,#1a3a5c 100%); display: flex; flex-direction: column; align-items: center; justify-content: center; cursor: pointer; transition: opacity 0.3s; }
    .video-overlay.hidden { opacity: 0; pointer-events: none; }
    .video-grid { position: absolute; inset: 0; background-image: linear-gradient(rgba(26,127,110,0.08) 1px,transparent 1px),linear-gradient(90deg,rgba(26,127,110,0.08) 1px,transparent 1px); background-size: 30px 30px; }
    .play-btn { width: 64px; height: 64px; border-radius: 50%; background: rgba(255,255,255,0.15); border: 2px solid rgba(255,255,255,0.6); display: flex; align-items: center; justify-content: center; position: relative; z-index: 2; transition: transform 0.2s; }
    .play-btn:hover { transform: scale(1.1); }
    .play-icon { width: 0; height: 0; border-style: solid; border-width: 11px 0 11px 20px; border-color: transparent transparent transparent white; margin-left: 5px; }
    .video-hint { color: rgba(255,255,255,0.7); font-size: 12px; margin-top: 12px; position: relative; z-index: 2; }
    .video-info { padding: 14px 16px 10px; }
    .video-title-ja { font-size: 13px; font-weight: 300; color: var(--navy); line-height: 1.4; }
    .video-title-vn { font-size: 16px; font-weight: 700; color: var(--teal); margin-top: 3px; }
    .progress-card { margin: 12px 16px; background: var(--gray-100); border-radius: 12px; padding: 14px; border: 1px solid var(--gray-200); }
    .progress-header { display: flex; justify-content: space-between; align-items: center; margin-bottom: 10px; }
    .progress-title { font-size: 12px; font-weight: 700; color: var(--navy); text-transform: uppercase; letter-spacing: 0.5px; }
    .progress-count { font-size: 13px; font-weight: 700; color: var(--teal); }
    .progress-bar-bg { height: 8px; background: var(--gray-200); border-radius: 4px; overflow: hidden; }
    .progress-bar-fill { height: 100%; width: 37%; background: linear-gradient(90deg,var(--teal),var(--teal-light)); border-radius: 4px; }
    .progress-labels { display: flex; justify-content: space-between; margin-top: 5px; }
    .progress-label { font-size: 11px; color: var(--gray-400); }
    .btn-to-test { display: block; margin: 16px; background: var(--teal); color: var(--white); font-size: 15px; font-weight: 700; padding: 16px; border-radius: 12px; text-align: center; border: none; cursor: pointer; width: calc(100% - 32px); }
    .btn-to-test:hover { background: var(--teal-light); }

    /* TEST */
    .test-header { background: var(--navy); padding: 14px 16px; display: flex; align-items: center; justify-content: space-between; }
    .test-title { color: var(--white); font-size: 14px; font-weight: 700; }
    .test-progress-pills { display: flex; gap: 5px; }
    .pill { width: 22px; height: 6px; border-radius: 3px; background: rgba(255,255,255,0.2); transition: all 0.3s; }
    .pill.done { background: var(--teal-light); }
    .pill.current { background: var(--orange); }

    .question-wrap { padding: 18px 16px 0; }
    .question-num { font-size: 11px; color: var(--gray-400); font-weight: 700; letter-spacing: 1px; text-transform: uppercase; }
    .question-text-ja { font-size: 13px; font-weight: 300; color: var(--navy); line-height: 1.5; margin-top: 6px; }
    .question-text-vn { font-size: 16px; font-weight: 700; color: var(--teal); margin-top: 4px; line-height: 1.5; }

    .choices { padding: 14px 16px; display: flex; flex-direction: column; gap: 10px; }
    .choice { padding: 14px; border-radius: 10px; border: 2px solid var(--gray-200); background: var(--white); display: flex; align-items: flex-start; gap: 12px; min-height: 54px; cursor: pointer; transition: all 0.2s; }
    .choice:hover:not(.disabled) { border-color: var(--teal); background: rgba(26,127,110,0.03); }
    .choice.correct { border-color: var(--green); background: var(--green-light); }
    .choice.wrong-selected { border-color: var(--red); background: var(--red-light); }
    .choice.disabled { cursor: default; }
    .choice-radio { width: 22px; height: 22px; border-radius: 50%; border: 2px solid var(--gray-200); flex-shrink: 0; display: flex; align-items: center; justify-content: center; margin-top: 2px; transition: all 0.2s; }
    .choice.correct .choice-radio { border-color: var(--green); background: var(--green); }
    .choice.wrong-selected .choice-radio { border-color: var(--red); background: var(--red); }
    .choice-radio-dot { width: 10px; height: 10px; border-radius: 50%; background: white; }
    .choice-text-ja { font-size: 12px; font-weight: 300; color: var(--navy); line-height: 1.4; }
    .choice-text-vn { font-size: 14px; font-weight: 700; color: var(--gray-600); margin-top: 2px; line-height: 1.4; }

    .feedback-area { padding: 0 16px 14px; display: none; }
    .feedback-area.show { display: block; }
    .feedback-banner { padding: 14px; border-radius: 10px; display: flex; align-items: flex-start; gap: 10px; margin-bottom: 12px; }
    .feedback-banner.correct-fb { background: var(--green-light); border: 1.5px solid var(--green); }
    .feedback-banner.wrong-fb { background: var(--red-light); border: 1.5px solid var(--red); }
    .feedback-icon { font-size: 22px; line-height: 1; flex-shrink: 0; }
    .feedback-title { font-size: 14px; font-weight: 700; }
    .correct-fb .feedback-title { color: var(--green); }
    .wrong-fb .feedback-title { color: var(--red); }
    .feedback-text { font-size: 11px; font-weight: 300; color: var(--gray-600); margin-top: 3px; line-height: 1.6; }
    .feedback-text .vn { font-weight: 700; font-size: 13px; }

    .btn-next { display: block; background: var(--orange); color: var(--white); font-size: 16px; font-weight: 700; padding: 16px; border-radius: 12px; text-align: center; border: none; cursor: pointer; width: 100%; }
    .btn-next:hover { background: var(--orange-dark); }

    /* RESULT */
    .result-screen { padding: 32px 24px; text-align: center; display: flex; flex-direction: column; align-items: center; }
    .result-emoji { font-size: 64px; margin-bottom: 16px; }
    .result-score { font-size: 48px; font-weight: 700; color: var(--navy); }
    .result-score span { font-size: 20px; color: var(--gray-400); font-weight: 300; }
    .result-label { font-size: 16px; font-weight: 700; color: var(--teal); margin: 8px 0 4px; }
    .result-vn { font-size: 14px; font-weight: 300; color: var(--gray-600); margin-bottom: 24px; }
    .result-bar-bg { width: 100%; height: 12px; background: var(--gray-200); border-radius: 6px; overflow: hidden; margin-bottom: 24px; }
    .result-bar-fill { height: 100%; border-radius: 6px; background: linear-gradient(90deg,var(--teal),var(--teal-light)); transition: width 1s ease; }
    .result-comments { width: 100%; text-align: left; margin-bottom: 24px; }
    .result-comment-item { padding: 12px; border-radius: 10px; margin-bottom: 8px; border: 1px solid var(--gray-200); }
    .result-comment-item.c-correct { background: var(--green-light); border-color: var(--green); }
    .result-comment-item.c-wrong { background: var(--red-light); border-color: var(--red); }
    .result-q { font-size: 11px; font-weight: 300; color: var(--gray-600); }
    .result-status { font-size: 12px; font-weight: 700; margin-top: 2px; }
    .c-correct .result-status { color: var(--green); }
    .c-wrong .result-status { color: var(--red); }
    .btn-retry { display: block; background: var(--navy); color: var(--white); font-size: 15px; font-weight: 700; padding: 16px; border-radius: 12px; text-align: center; border: none; cursor: pointer; width: 100%; margin-bottom: 10px; }
    .btn-retry:hover { background: #1a3060; }
    .safe-bottom { height: 24px; }
  </style>
</head>

    feedback_ja: 'Âà©Áî®ËÄÖ„Åã„ÇâË®¥„Åà„Åå„ÅÇ„Å£„ÅüÂ†¥Âêà„ÅØÂøÖ„ÅöÂãï‰Ωú„ÇíÊ≠¢„ÇÅ„ÄÅÁä∂ÊÖã„ÇíÁ¢∫Ë™ç„Åó„Å¶„Åè„Å†„Åï„ÅÑ„ÄÇÂÆâÂÖ®Á¢∫‰øù„ÅåÊúÄÂÑ™ÂÖà„Åß„Åô„ÄÇ',
    feedback_vn: 'Khi ng∆∞·ªùi d√πng c√≥ y√™u c·∫ßu, h√£y d·ª´ng l·∫°i v√† ki·ªÉm tra t√¨nh tr·∫°ng. ƒê·∫£m b·∫£o an to√†n l√† ∆∞u ti√™n h√†ng ƒë·∫ßu.',
  },
];

let currentQ = 0;
let answers = new Array(questions.length).fill(null);
let answered = false;

function renderQuestion() {
  if (currentQ >= questions.length) { showResult(); return; }
  answered = false;
  const q = questions[currentQ];
  document.getElementById('result-area').style.display = 'none';
  const area = document.getElementById('question-area');
  area.style.display = 'block';

  // Pills
  let pillsHTML = '';
  for (let i = 0; i < questions.length; i++) {
    let cls = i < currentQ ? 'done' : i === currentQ ? 'current' : '';
    pillsHTML += `<div class="pill ${cls}"></div>`;
  }
  document.getElementById('pills').innerHTML = pillsHTML;

  // Choices
  let choicesHTML = '';
  q.choices.forEach((c, i) => {
    choicesHTML += `
      <div class="choice" id="choice-${i}" onclick="selectAnswer(${i})">
        <div class="choice-radio" id="radio-${i}"></div>
        <div>
          <div class="choice-text-ja">${c.ja}</div>
          <div class="choice-text-vn">${c.vn}</div>
        </div>
      </div>`;
  });

  const isLast = currentQ === questions.length - 1;
  area.innerHTML = `
    <div class="question-wrap">
      <div class="question-num">Âïè${currentQ + 1} / ÂÖ®${questions.length}Âïè</div>
      <div class="question-text-ja">${q.ja}</div>
      <div class="question-text-vn">${q.vn}</div>
    </div>
    <div class="choices">${choicesHTML}</div>
    <div class="feedback-area" id="feedback-area">
      <div class="feedback-banner" id="feedback-banner">
        <div class="feedback-icon" id="feedback-icon"></div>
        <div>
          <div class="feedback-title" id="feedback-title"></div>
          <div class="feedback-text" id="feedback-text"></div>
        </div>
      </div>
      <button class="btn-next" onclick="nextQuestion()">${isLast ? 'ÁµêÊûú„ÇíË¶ã„Çã„ÄÄ‚Üí' : 'Ê¨°„ÅÆÂïèÈ°å„Å∏„ÄÄ‚Üí'}</button>
    </div>`;
}

function selectAnswer(idx) {
  if (answered) return;
  answered = true;
  answers[currentQ] = idx;
  const q = questions[currentQ];
  const isCorrect = idx === q.correct;

  q.choices.forEach((_, i) => {
    const el = document.getElementById('choice-' + i);
    const radio = document.getElementById('radio-' + i);
    el.classList.add('disabled');
    if (i === q.correct) {
      el.classList.add('correct');
      radio.innerHTML = '<div class="choice-radio-dot"></div>';
    } else if (i === idx && !isCorrect) {
      el.classList.add('wrong-selected');
      radio.innerHTML = '<div class="choice-radio-dot"></div>';
    }
  });

  const fb = document.getElementById('feedback-area');
  const banner = document.getElementById('feedback-banner');
  fb.classList.add('show');
  if (isCorrect) {
    banner.className = 'feedback-banner correct-fb';
    document.getElementById('feedback-icon').textContent = '‚úÖ';
    document.getElementById('feedback-title').textContent = 'Ê≠£Ëß£„Åß„ÅôÔºÅ ƒê√∫ng r·ªìiÔºÅ';
  } else {
    banner.className = 'feedback-banner wrong-fb';
    document.getElementById('feedback-icon').textContent = '‚ùå';
    document.getElementById('feedback-title').textContent = '‰∏çÊ≠£Ëß£„Åß„Åô„ÄÇ Sai r·ªìi.';
  }
  document.getElementById('feedback-text').innerHTML =
    `${q.feedback_ja}<br><br><span class="vn">${q.feedback_vn}</span>`;
}

function nextQuestion() {
  currentQ++;
  renderQuestion();
  window.scrollTo(0, 0);
}

function showResult() {
  document.getElementById('question-area').style.display = 'none';
  const resultArea = document.getElementById('result-area');
  resultArea.style.display = 'block';
  const score = answers.filter((a, i) => a === questions[i].correct).length;
  const pct = Math.round((score / questions.length) * 100);

  let emoji = 'üòä', labelJa = 'ÂêàÊ†º„Åß„ÅôÔºÅ„Çà„Åè„Åß„Åç„Åæ„Åó„ÅüÔºÅ', labelVn = 'ƒê·∫°t! B·∫°n ƒë√£ l√†m t·ªët!';
  if (pct === 100) { emoji = 'üéâ'; labelJa = 'Ê∫ÄÁÇπÔºÅÁ¥†Êô¥„Çâ„Åó„ÅÑÔºÅ'; labelVn = 'Ho√†n h·∫£o! Tuy·ªát v·ªùi!'; }
  else if (pct < 67) { emoji = 'üìö'; labelJa = '„ÇÇ„ÅÜ‰∏ÄÂ∫¶Âæ©Áøí„Åó„Åæ„Åó„Çá„ÅÜ'; labelVn = 'H√£y √¥n t·∫≠p l·∫°i nh√©'; }

  let commentsHTML = '';
  questions.forEach((q, i) => {
    const ok = answers[i] === q.correct;
    commentsHTML += `
      <div class="result-comment-item ${ok ? 'c-correct' : 'c-wrong'}">
        <div class="result-q">Âïè${i+1}: ${q.ja.substring(0,26)}‚Ä¶</div>
        <div class="result-status">${ok ? '‚úÖ Ê≠£Ëß£ / ƒê√∫ng' : '‚ùå ‰∏çÊ≠£Ëß£ / Sai'}</div>
      </div>`;
  });

  resultArea.innerHTML = `
    <div class="result-screen">
      <div class="result-emoji">${emoji}</div>
      <div class="result-score">${score}<span> / ${questions.length}Âïè</span></div>
      <div class="result-label">${labelJa}</div>
      <div class="result-vn">${labelVn}</div>
      <div class="result-bar-bg"><div class="result-bar-fill" id="result-bar" style="width:0%"></div></div>
      <div class="result-comments">${commentsHTML}</div>
      <button class="btn-retry" onclick="retryTest()">„ÇÇ„ÅÜ‰∏ÄÂ∫¶ÊåëÊà¶„Åô„Çã / Th·ª≠ l·∫°i</button>
    </div>`;

  setTimeout(() => { document.getElementById('result-bar').style.width = pct + '%'; }, 100);
  let pillsHTML = '';
  for (let i = 0; i < questions.length; i++) pillsHTML += `<div class="pill done"></div>`;
  document.getElementById('pills').innerHTML = pillsHTML;
}

function retryTest() {
  currentQ = 0;
  answers = new Array(questions.length).fill(null);
  answered = false;
  renderQuestion();
  window.scrollTo(0, 0);
}

renderQuestion();
</script>
</body>
</html>
